pragma solidity ^0.4.18;

contract RedPacket {

//struct
    struct User {
        uint256 user_key;
        uint256[] packet_create;                //
        uint256[] packet_get;                   //
    }

    struct Record {
        uint256 record_key;                     //key
        uint256 packet_key;                     //key
        uint256 number;                         //
        address get_address;                    //
        uint256 time;                           //
        uint256 money;                          //
    }

    struct Packet {
        uint256 packet_key;                     //key
        address create_address;                 //
        uint256 time;                           //
        uint256 money;                          //
        uint256 all_count;                      //
        uint256 count;                          //
        bool ave;                               //
        bool crypto;                            //
        string password;                        //
        bool finish;                            //
        uint256[] records;                     //
        bool flag;                              //
        uint256 balance;                        //
        string content;                         //
    }

//para
    uint256 tron = 1000000;                 //
    //uint256 tron = 1000000000000000000; 
    uint256 packetkey = 1;                 //key
    uint256 recordkey = 1;                 //key
    uint256 userkey = 1;                 //key
    uint256 finishkey = 1;
    address owneraddress;


//mapping
    mapping(uint256 => Packet) packets;
    mapping(address => User) users;
    mapping(uint256 => Record) records;
    mapping(uint256 => uint256) finishpackets;

//event
    event createPacketSuccess(uint256);
    event getPacketSuccess(uint256);

//tron
    constructor () public {
        owneraddress = msg.sender;        
        //init();         
    }
/*
    function init () public {

    }
*/

//modifier
    modifier onlyOwner () {
        require(msg.sender == owneraddress);
        _;
    }

//user
    function checkUser() private view returns (bool) {
        User memory user = users[msg.sender];
        if(user.user_key > 0) {
            return true;
        }
        return false;
    }

    function getUserkey () private view returns(uint256) {
        return userkey;
    }

    function createUser () private {
        uint256 _user_key = getUserkey();
        uint256[] memory _packet_create;
        uint256[] memory _packet_get;
        User memory user = User({user_key:_user_key, packet_create:_packet_create, packet_get:_packet_get});
        users[msg.sender] = user;
    }

    function getUser () public view returns (uint256, uint256[], uint256[]) {
        User memory user = users[msg.sender];
        return(user.user_key, user.packet_create, user.packet_get);
    }


    function updatePacketcreate (uint256 _packet_key) private {
        User storage user = users[msg.sender];
        uint256[] storage _packet_create = user.packet_create;
        bool flag = true;
        for(uint256 i = 0; i < _packet_create.length; i++){
            if(_packet_create[i] == _packet_key) {
                flag = false;
                break;
            }
        }
        if(flag){
            _packet_create.push(_packet_key);
            user.packet_create = _packet_create;
            users[msg.sender] = user;
        }  
    }

    function updatePacketget (uint256 _packet_key) private {
        User storage user = users[msg.sender];
        uint256[] storage _packet_get = user.packet_get;
        bool flag = true;
        for(uint256 i = 0; i < _packet_get.length; i++){
            if(_packet_get[i] == _packet_key) {
                flag = false;
                break;
            }
        }
        if(flag){
            _packet_get.push(_packet_key);
            user.packet_get = _packet_get;
            users[msg.sender] = user;
        }
    }

//packet
    function getPacketstruct (uint256 _key) public view returns (uint256, address, uint256, uint256, uint256, uint256, bool, bool, bool, uint256[], uint256, string) {
        Packet memory packet = packets[_key];
        return(packet.packet_key, packet.create_address, packet.time, packet.money, packet.all_count, packet.count, packet.ave, packet.crypto, packet.finish, packet.records, packet.balance, packet.content);
    }

    function getPacketkey () public view returns (uint256) {
        return(packetkey);
    }

    function updatePacketkey () private {
        packetkey++;
    }

    //create packet
    function createPacket (uint256 _money, uint256 _all_count, bool _ave, bool _crypto, string _password, string _content) public payable {
        require(_money > _all_count);
        require(msg.value >= _money * tron);
        if(checkUser() == false) {
            createUser();
        }
        uint256 _packet_key = getPacketkey();
        uint256[] memory _records;
        Packet memory packet = Packet({packet_key:_packet_key, create_address:msg.sender,time:now,money:_money * tron ,all_count:_all_count,count:0,ave:_ave,crypto:_crypto,password:_password,finish:false, records:_records, flag:true, balance:_money * tron, content:_content});
        packets[_packet_key] = packet;
        updatePacketkey ();
        updatePacketcreate(_packet_key);
        emit createPacketSuccess(_packet_key);
    }

   //check

   //check have finish

    function checkFinish (uint256 _packet_key) private view returns(bool) {
        Packet memory packet = packets[_packet_key];
        return packet.finish;
    }

    function checkPacketget (uint256 _packet_key) private view returns(bool) {
        User memory user = users[msg.sender];
        uint256[] memory getlist = user.packet_get;
        bool flag = false;
        for(uint256 i = 0; i < getlist.length; i++){
            if(getlist[i] == _packet_key) {
                flag = true;
                break;
            }
        }
        return flag;
    }

    function checkGet(uint256 _packet_key) private view returns(bool) {
        if((checkFinish(_packet_key) == false) && (checkPacketget(_packet_key) == false)) {
            return true;
        }
        return false;
    }

    function getRecordkey () public view returns (uint256) {
        return recordkey;
    }

    function getRandommoney (uint256 max_money) private view returns (uint256) {
        uint256 money = uint256(sha256(abi.encodePacked(now, msg.sender))) % max_money + 1;
        return money;
    }

    function getFinishkey () public view returns (uint256) {
        return finishkey;
    }

    function getFinishpacket (uint256 _key) public view returns (uint256) {
        return finishpackets[_key];
    }

    function addFinishkey () private {
        finishkey ++;
    }

    function addFinishpacket (uint256 _packet_key) private {
        uint256 _finishkey = getFinishkey();
        finishpackets[_finishkey] = _packet_key;
        addFinishkey();
    }

    function updatePacket (uint256 _packet_key) private {
        Packet storage packet = packets[_packet_key];
        require(packet.flag);
        packet.flag = false;
        packets[_packet_key] = packet;
        packet.count ++;
        uint256 get_money;
        if(packet.count == packet.all_count){
            get_money = packet.balance;
        }
        else if (packet.ave) {
            get_money = packet.money / packet.all_count;
        }
        else {
            uint256 max_money = packet.balance - (packet.all_count - packet.count);
            get_money = getRandommoney(max_money);
        }
        uint256 _number = packet.count;
        if(packet.count == packet.all_count) {
            packet.finish = true;
            addFinishpacket(_packet_key);
        }
        uint256[] storage _records = packet.records;
        uint256 _record_key = getRecordkey();
        addRecord(_record_key, _packet_key, _number, get_money);
        _records.push(_record_key);
        packet.records = _records;
        packet.balance = packet.balance - get_money;
        packet.flag = true;
        packets[_packet_key] = packet;
        msg.sender.transfer(get_money);
    }   

    function addRecord (uint256 _record_key, uint256 _packet_key, uint256 _number, uint256 _money) private {
        Record memory record = Record({record_key:_record_key, packet_key:_packet_key, number:_number, get_address:msg.sender, time:now, money:_money});
        records[_record_key] = record;
        recordkey ++;
    }

    function getRecord (uint256 _record_key) public view returns (uint256, address, uint256, uint256) {
        Record memory record = records[_record_key];
        return(record.number, record.get_address, record.time, record.money);
    }

    function strEqual(string strA, string strB) private pure returns(bool) {
        bytes memory byteA = bytes(strA);
        bytes memory byteB = bytes(strB);
        if (byteA.length != byteB.length) {
            return false;
        }else {
            for (uint256 i=0; i < byteA.length; i++){
                if (byteA[i] != byteB[i]) {
                    return false;
                }
            }
        }
        return true;
    }

    function checkPassword(uint256 _packet_key, string _password) private view returns(bool) {
        Packet memory packet = packets[_packet_key];
        if(packet.crypto == false) {
            return true;
        }
        else {
            if(strEqual(_password,packet.password)) {
                return true;
            }
            return false;
        }
    }

    function getPacket (uint256 _packet_key, string _password) public {
        if(checkUser() == false) {
            createUser();
        }
        require(checkGet(_packet_key));
        require(checkPassword(_packet_key,_password));
        updatePacket(_packet_key);
        updatePacketget(_packet_key);
        emit getPacketSuccess(_packet_key);
    }
}
